import React from "react"
import NINE from "../nl_logo.png";
import {BrowserRouter,Link} from "react-router-dom";
import { Form, TextArea,Label ,Icon} from 'semantic-ui-react'


class Empheader extends React.Component {
    onLogoutClic(){
        localStorage.clear();
        window.location="/login"
    }

    render() {
        function onItemClick(){
            window.location="/e"
        }


        return (
            <BrowserRouter>
            <header>
                <div className="header">
                    <nav>
                        <div className="">
                        <Link onClick={onItemClick} > <img   src={NINE} alt="nineleaps"/> </Link>

                        <Link onClick={onItemClick } style={{marginLeft:"300px"}} > <Icon name='home' />   Home </Link> ||

                           <Link onClick={this.onLogoutClic} style={{marginInlineStart:"left"}}> <Icon name='sign-out' /> Logout</Link>

                        </div>

                    </nav>

                </div>
            </header>
            </BrowserRouter>

        )
    }
}
export default Empheader
